/**
 * @param {string} s
 * @param {number} k
 * @return {string}
 */
var removeDuplicates = function (s, k) {
    let reg = new RegExp('([a-z])\\1{' + (k - 1) + '}', 'g')
    while (reg.test(s)) {
        s = s.replace(reg, '') || s
    }
    return s
};

console.log(removeDuplicates("", 2))

